export interface Money {
  min: number;
  max: number;
}

export interface State {
  locateCity: string;
  locateAddress: string;
  currentCity: string;
  roomCurrentRegion: string;
  currentTab: number;
  roomCostMin: number;
  roomCostMax: number;
  hasShortRent: number;
  hasVideo: number;
  subwayLine: string;
  roomGender: string;
  type: string;
  roomTypeAffirm: string;
  roomSequence: string;
  longitude: number;
  latitude: number;
  hasRoomNextPage: boolean;
  searchByCity: boolean;
  searchByInput: boolean;
  searchByVideo: boolean;
  searchByType: boolean;
  searchByOther: boolean;
  searchDemandByInput: boolean;
  searchDemandBySex: boolean;
  searchDemandByMoney: boolean;
  cityList: any;
  initRegions: any[];
  initLines: any[];
  roomList: any[];
  openInputSearchList: boolean;
  inputSearchList: any[];
  demandCurrentRegion: string;
  demandSequence: string;
  demandLongitude: number;
  demandLatitude: number;
  demandGender: string;
  demandMoney: Money;
  demandList: any[];
  hasDemandNextPage: boolean;
  isLogged: boolean;
  uid: string;
}

export const state: State = {
  currentTab: 0, // 当前tab选项
  // 身份信息
  isLogged: false, // 是否登录
  uid: '', // 用户id
  // 房源
  // 房源搜索条件
  roomCurrentRegion: '', // 当前区域
  roomCostMin: 0, // 最低价
  roomCostMax: 0, // 最高价
  hasShortRent: 0, // 允许短租 0不允许1允许
  hasVideo: 0, // 1包含 0 或者不传则代表不限
  subwayLine: '', // 地铁线
  roomGender: '', // 床位限性别  m男f女
  type: '', // 床位类型	1 单间 2单个床位 3整租;多个以，分割，如1,2
  roomTypeAffirm: '', // 房源类型 多个以，分割，如包租公寓，转租公寓
  roomSequence: '', // 房源排序值
  longitude: -1, // 经度
  latitude: -1, // 纬度
  hasRoomNextPage: true, // 是否有下一页数据
  // 房源搜索条件选择
  searchByCity: false, // 是否通过城市搜索
  searchByInput: false, // 是否通过输入搜索
  searchByVideo: false, // 是否通过视频搜索
  searchByType: false, // 是否通过整租合租搜索
  searchByOther: false, // 是否通过更多搜索
  // 列表
  roomList: [], // 房源信息列表
  // 求租
  // 求租搜索条件
  demandCurrentRegion: '', // 当前区域
  demandSequence: '', // 求租排序值
  demandLongitude: -1, // 求租经度
  demandLatitude: -1, // 求租纬度
  demandGender: '', // 求租性别
  demandMoney: {
    min: 0, // 求租最低价格
    max: 0, // 求租最高价格
  },
  hasDemandNextPage: true, // 求租是否有下一页
  // 求租搜索条件选择
  searchDemandByInput: false, // 是否通过输入搜索求租
  searchDemandBySex: false, // 是否通过性别搜索求租
  searchDemandByMoney: false, // 是否通过预算搜索求租
  // 求租列表
  demandList: [],
  // 搜索列表部分
  openInputSearchList: false, // 是否打开输入搜索列表
  inputSearchList: [], // 输入搜索地址
  // 定位
  locateCity: '', // 定位当前城市
  locateAddress: '', // 定位当前地址
  currentCity: '上海', // 当前城市
  cityList: {}, // 城市列表
  initRegions: [], // 初始化城市信息
  initLines: [], // 初始化地铁线
};
